import React from 'react';  
// import {Component} from 'react';  
import './App.css';

const App = () => {
  return (
	<div className="app-wrapper">	
	<header className="header">
		<img src="https://w7.pngwing.com/pngs/635/870/png-transparent-logo-flower-flower-purple-violet-logo-thumbnail.png" />  
	</header>  	
	<nav className="nav">
		<div>
			<a>	Profile </a>  
	    </div>  
		<div>
			Messages  
	    </div>  
	</nav>  	
		<div className="content">
			Main content   
	    </div> 
	</div>
  );
}

export default App;
